import React from 'react';

function ImageSlider() {
  return (
    <div className="image-slider">
      <img src='https://images.unsplash.com/photo-1414694762283-acccc27bca85?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=2379&q=80'/>
    </div>
  );
}

export default ImageSlider;
